import styled from 'styled-components';
import Number from "./number";
const Wheel = () => {
    
    let Container = styled.div `
    max-width: 1200px;
    height: 100px;
    border: solid black 1px;
    display: flex;
    align-items: center;
    justify-content: center;
    `
    return (
        <Container>
            <Number />
            <Number />
            <Number />
            <Number />
            <Number />
            <Number />
            <Number />
            <Number />
            <Number />
        </Container>
    )
}

export default Wheel;
